import { Container, Row } from "react-bootstrap";
import { Navbar, Nav, NavDropdown } from "react-bootstrap";
export default function Home() {
  return <div>

  <div class="position-relative overflow-hidden p-3 p-md-5 m-md-3 text-center bg-light">
    <div class="col-md-5 p-lg-5 mx-auto my-5 d-inline">
      <h1 class="display-1 d-sm-block">NOXUS</h1>
      <p class="lead fw-normal d-sm-block">Base de datos oficial de la ciudad de Noxus.</p>
      <div align="left"><img class="rounded float-left" width="200" height="200" src="https://ih1.redbubble.net/image.437189184.9821/flat,750x,075,f-pad,750x1000,f8f8f8.jpg" class="img-thumbnail" alt="..."></img></div>
    </div>

  </div>

  </div>;
}
